def MinSkew(Pattern):
    Array = []
    maxArray = []
    min = 0
    for i in range(len(Pattern)+1):
        Array.append(0)
    for i in range(len(Pattern)):
        if Pattern[i] == 'C':
            Array[i+1] = Array[i]-1
        elif  Pattern[i] == 'G':
            Array[i+1] = Array[i]+1
        else:
            Array[i+1] = Array[i]
    for i in range(len(Array)):
        if min>Array[i]:
            min = Array[i]
    for i in range(len(Array)):
        if Array[i] == min:
            maxArray.append(i)
    return maxArray

print(MinSkew(""))